import React, { Component } from 'react';

class Info extends Component {

  render() {
    return (
      <div>
        <h1>Hello</h1>
        <label htmlFor="player1">Player 1</label>
        <input onKeyUp={this.props.onKeyUpInput} type="text" id="player1"/>
        <br/>
        <label htmlFor="player1">Player 2</label>
        <input onKeyUp={this.props.onKeyUpInput} type="text" id="player2"/>
        <br/>
        <button>Start playing</button>
      </div>
    )
  }
} 

export default Info;
